        public string GetTypeName(int MainType)
        {
            switch (MainType)
            {
                case 1:
                    return "Ethical Perfectionist Type 1";

                case 2:
                    return "Empathic Nurturer Type 2";

                case 3:
                    return "Ambitious Achiever Type 3";

                case 4:
                    return "Intense Individualist Type 4";

                case 5:
                    return "Perceptive Specialist Type 5";

                case 6:
                    return "Dutiful Loyalist Type 6";

                case 7:
                    return "Versatile Visionary Type 7";

                case 8:
                    return "Charismatic Controller Type 8";

                case 9:
                    return "Receptive Peacemaker Type 9";

                default:
                    return "";
            }
        }

