           // SendMailWithAttachment(FinalPdfByte, UserModel.FirstName + " " + UserModel.LastName);
            
            return FinalPdfByte;
        }
        private byte[] ConvertListOf_QSSSR_FileInByteFormate(int TestId, CandidateBM UserModel, int MainType,string hostname)
        {
            var buildDir = AppDomain.CurrentDomain.BaseDirectory;

            string QSSSR_HTMLPath = buildDir + "\\HTML File\\QSSSR\\QSSSR_Report.html";

            string QSSSR_HTML = File.ReadAllText(QSSSR_HTMLPath);

            QSSSR_HTML = Convert_QSSR_HTML_To_OrignalHTMLString(QSSSR_HTML, UserModel, MainType, hostname);

            return Convert_QSSSRHtml_To_ByteFormat(QSSSR_HTML);
        }
