        private int GetQssrTypeWiseScore(int TypeId)
        {
            Dictionary<int, int> TypeWiseScore = new Dictionary<int, int>()
            {
                {1,20},{2,22},{3,30},{4,15},{5,16},{6,24},{7,28},{8,26},{9,18}
