        public byte[] GenerateQLeapReport(int TestId,string hostname)
        {
            CandidateBM UserModel = UserSrv.GetCandidateData(TestId);

            var MainType_Mistyping = DBEntities.txnDynamicMisTypings.Where(x => x.TestId == TestId && x.Type == 1)
                                   .OrderByDescending(x => x.MisTypingId).Select(i => i.HighestType).FirstOrDefault();

            List<byte[]> PagesInByte = ConvertQLeapFileInByteFormate(UserModel.UserTestId, UserModel, Convert.ToInt32(MainType_Mistyping), hostname);

            byte[] FinalPdfByte = concatAndAddContent(PagesInByte);

            return FinalPdfByte;
        }

        public List<byte[]> ConvertQLeapFileInByteFormate(int TestId, CandidateBM UserModel, int MainType,string hostname)
        {
            List<byte[]> lstbyte = new List<byte[]>();

            var buildDir = AppDomain.CurrentDomain.BaseDirectory;

            string ListOfFileInFolderPath = buildDir + "\\HTML File\\QLeap\\";

            string[] ListOfFile = Directory.GetFiles(ListOfFileInFolderPath, "*.html");

            int i = 1;

            foreach (string FilePath in ListOfFile)
            {
                string QMAP_HTML = File.ReadAllText(FilePath);

                QMAP_HTML = ReplaceCandidateDataInQLeapHtml(QMAP_HTML, UserModel, MainType, Path.GetFileName(FilePath), hostname);

                byte[] PdfByte = ConvertQleapHTMLFileToByteFormate(QMAP_HTML, i);

                lstbyte.Add(PdfByte);

                i++;
            }

            return lstbyte;
        }


        public byte[] ConvertQleapHTMLFileToByteFormate(string HtmlFile, int CurentPgNo)
        {
            string pdf_page_size = "A4";
            PdfPageSize pageSize = (PdfPageSize)Enum.Parse(typeof(PdfPageSize), pdf_page_size, true);

            string pdf_orientation = "Portrait";
            PdfPageOrientation pdfOrientation = (PdfPageOrientation)Enum.Parse(typeof(PdfPageOrientation), pdf_orientation, true);

            int webPageWidth = 1024;
            int webPageHeight = 0;

            HtmlToPdf converter = new HtmlToPdf();

            converter.Options.PdfPageSize = pageSize;
            converter.Options.PdfPageOrientation = pdfOrientation;
            converter.Options.WebPageWidth = webPageWidth;
            converter.Options.WebPageHeight = webPageHeight;


            if (CurentPgNo >= 2)
            {
                converter.Options.DisplayFooter = true;
                converter.Footer.Height = 35f;
                //converter.Footer.DisplayOnFirstPage = true;

                string htmlfooter = @"<html><head><style type='text/css'>hr {border: 0;border-top: 2px solid #ccc;}span{font-family: Segoe, 'Segoe UI', 'DejaVu Sans', 'Trebuchet MS', Verdana, 'sans-serif';font-size: 13px; color: darkgrey;margin: 67px;}</style></head><body><hr><table>
                                    <tr><td><img style ='width:30px;height:30px;'
                                    src='data:image/png;base64, ' />
                                    </td><td><span>Copyright (2023) Questa Enneagram Private Limited</span></td></tr></table></body></html>";

                PdfHtmlSection footerHtml = new PdfHtmlSection(htmlfooter, "");
                footerHtml.AutoFitHeight = HtmlToPdfPageFitMode.AutoFit;
                converter.Footer.Add(footerHtml);

            }


            PdfDocument doc = converter.ConvertHtmlString(HtmlFile);

            byte[] Report = doc.Save();

            doc.Close();

            return Report;

        }
        public string CreateDateSuffix(DateTime date)
        {
            // Get day...
            var day = date.Day;

            // Get day modulo...
            var dayModulo = day % 10;

            // Convert day to string...
            var suffix = day.ToString(System.Globalization.CultureInfo.InvariantCulture);

            // Combine day with correct suffix...
            suffix += (day == 11 || day == 12 || day == 13) ? "th" :
                (dayModulo == 1) ? "st" :
                (dayModulo == 2) ? "nd" :
                (dayModulo == 3) ? "rd" :
                "th";
            suffix = suffix + " " + date.ToString("MMMM") + " " + date.ToString("yyyy");
            // Return result...
            return suffix  ;
        }
